import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import { DataProvider } from "./GlobalState";
import { Switch } from "react-router-dom";
import Header from "./components/headers/Header";

function App() {
  return (
    <DataProvider>
      <Router>
        <div className="App">
          <Header />
          <Switch></Switch>
        </div>
      </Router>
    </DataProvider>
  );
}

export default App;
